INSERT INTO `recipes` VALUES (1,'Lentil, Apple, and Turkey Wrap',131,2.500,1,NULL,'2006-09-01 04:00:00'),(2,'Boudin Blanc Terrine with Red Onion Confit',131,4.375,1,'This uses the same ingredients found in boudin blanc, the classic French white sausage. Start two days before serving.','2004-08-20 04:00:00'),(3,'Potato and Fennel Soup Hodge',131,3.750,1,NULL,'2004-08-20 04:00:00'),(4,'Mahi-Mahi in Tomato Olive Sauce',131,5.000,1,'The Sicilian-style tomato sauce has tons of Mediterranean flavor, thanks to the orange peel, olives, and oregano.','2009-03-27 04:00:00'),(5,'Spinach Noodle Casserole',131,3.125,1,NULL,'2004-08-20 04:00:00'),(6,'The Best Blts',131,4.375,1,'This recipe can be prepared in 45 minutes or less.','2004-08-20 04:00:00'),(7,'Ham and Spring Vegetable Salad with Shallot Vinaigrette',131,4.375,1,'Serve this newfangled main-course salad with a crisp flatbread, such as lavash, and white wine or rosé spritzers.','2004-08-20 04:00:00'),(8,'Spicy-Sweet Kumquats',131,3.750,1,'Pop one of these in your mouth for a burst of bittersweet flavor.','2004-08-20 04:00:00'),(9,'Korean Marinated Beef',131,4.375,1,'Bulgogi','2004-08-20 04:00:00'),(10,'Ham Persillade with Mustard Potato Salad and Mashed Peas',131,3.750,1,'Transform your picnic into un pique-nique to remember with this elegant arrangement of tangy potato salad, peas gently mashed with marjoram, and salty ham softly set in parsleyed gelatin.','2008-10-23 22:24:26'),(11,'Yams Braised with Cream, Rosemary and Nutmeg',131,3.750,1,'Simmering the yams fills them with flavor and yields a lovely coating.','2004-08-20 04:00:00'),(12,'Spicy Noodle Soup',131,4.375,1,'(Tony Tan\'s Laksa Lemak)','2004-08-20 04:00:00'),(13,'Banana-Chocolate Chip Cake With Peanut Butter Frosting',131,4.375,1,'This cake is perfect for beginners—it\'s moist, forgiving, and easy. Jif creamy peanut butter is our favorite for the decadent frosting.','2012-09-18 04:00:00'),(14,'Beef Tenderloin with Garlic and Brandy',131,4.375,1,'This recipe can be prepared in 45 minutes or less.','2004-08-20 04:00:00'),(15,'Peach Mustard',131,3.125,1,'Where a chutney and mustard sauce overlap. Choose a very ripe– even bruised–peach for easy peeling.','2014-06-17 04:00:00'),(16,'Raw Cream of Spinach Soup',131,4.375,1,'This uncooked soup isn\'t for the timid — raw garlic, ginger, and shallot impart strong flavors. Unless you can get freshly made vegetable juice from your local juice bar, you will need an electric juicer to make the tomato or carrot juice.','2004-08-20 04:00:00'),(17,'Sweet Buttermilk Spoon Breads',131,1.875,1,'Classic spoon bread is a savory pudding served as a side dish. In this dessert version, the slightly sweetened batter is baked in individual ramekins, then topped with strawberry preserves.','2008-12-04 04:00:00'),(18,'Crisp Braised Pork Shoulder',131,4.375,1,'Pork all over Denmark is hauntingly tender. Ruggiero was particularly taken with the pork belly she tasted at the restaurant Gammel Mønt—crisp, but succulent and rich. To re-create these qualities, Ruggiero devised a version that requires minimal effort but promises stunning results: Pork shoulder is braised first, until it\'s super tender, and then flash-seared for a golden crust. The aroma alone will convince you that this unorthodox technique is entirely worthwhile.','2007-02-14 21:13:14'),(19,'Mozzarella-Topped Peppers with Tomatoes and Garlic',131,5.000,1,NULL,'2004-08-20 04:00:00'),(20,'Tuna, Asparagus, and New Potato Salad with Chive Vinaigrette and Fried Capers',131,5.000,1,'A springy take on Niçoise salad, with radishes and asparagus in place of tomatoes and haricots verts.','2009-03-04 04:00:00'),(21,'Asian Pear and Watercress Salad with Sesame Dressing',131,4.375,1,'Active time: 20 min Start to finish: 20 min','2004-08-20 04:00:00'),(22,'\"Fried\" Chicken',131,3.750,1,'Nashville: Try the \"fried\" chicken, y\'all. Southern hospitality wouldn\'t be quite so hospitable without corn bread, collard greens, and, of course, fried chicken. If you haven\'t already guessed that grease is what\'s so \"finger-lickin\' good,\" we\'ll let you in on a secret: You can spend nearly half a day\'s calories on one thigh of this Southern-fried favorite. So make our baked version instead.','2006-05-16 20:10:20'),(23,'Fish Fillets in Parchment with Asparagus and Orange',131,3.750,1,'In this delicately flavored main course, the asparagus steams along with the fish in individual paper packets.','2008-02-27 21:40:23'),(24,'Pancetta and Taleggio Lasagna with Treviso',131,3.750,1,NULL,'2009-11-02 04:00:00'),(25,'Sea Salt-Roasted Pecans',131,3.750,1,NULL,'2007-01-18 04:25:29'),(26,'Garlic Baguette Crumbs',131,0.000,1,NULL,'2004-08-20 04:00:00'),(27,'Cucumber-Basil Egg Salad',131,3.750,1,'The glories of summer are captured in this pale green egg salad redolent of fresh basil, green onions, and crunchy cucumbers. Serve it surrounded by greens or tucked into pita loaves or slices of crusty bread for a satisfying lunch.','2011-03-31 04:00:00'),(28,'Dried Pear Crisps',131,2.500,1,'Use a V-slicer (a simple, inexpensive version of a mandoline available at cookware stores) for the paper-thin pear slices.','2007-07-26 17:36:37'),(29,'Green Bean, Red Onion, and Roast Potato Salad with Rosemary Vinaigrette',131,4.375,1,NULL,'2004-08-20 04:00:00'),(30,'Apricot-Cherry Shortcakes',131,4.375,1,'Here\'s a terrific light version of an American summer classic.','2004-08-20 04:00:00'),(31,'Asian Steak Topped with Bell Pepper Stir-Fry',131,4.375,1,'A steakhouse take on Thai beef with peppers. Serve with steamed rice.','2008-09-29 04:00:00'),(32,'Moroccan-Style Preserved Lemons',131,5.000,1,'Preserved lemons are perhaps most at home in Moroccan dishes, but we love their complex, bright flavor and aroma in all kinds of soups, stews, and salads. We\'ve adapted Mediterranean-food authority Paula Wolfert\'s quick method and made it even faster by blanching the lemons first. If you manage to find Meyer lemons, this is a great way to capture their unforgettable taste and perfume.','2008-04-16 21:03:11'),(33,'Roasted Sweet-Potato Spears with Bacon Vinaigrette',131,4.375,1,'Don\'t be surprised if these spears prove even more popular than the classic mash—they brown up beautifully, and it\'s hard to resist the siren call of bacon.','2006-10-19 04:19:58'),(34,'Deviled Ham',131,3.125,1,'Can be prepared in 45 minutes or less.','2004-08-20 04:00:00'),(35,'Fontina Mac with Squash and Sage',131,5.000,1,'\"Creamy squash and cheese crisps only make you think you\'re off the diet cliff!\" says James Beard award winner Laura Werlin, author of Mac & Cheese, Please! and The All American Cheese and Wine Book.','2013-11-13 04:00:00'),(36,'Aztec Chicken',131,3.750,1,NULL,'2004-08-20 04:00:00'),(37,'Pastry Twists with Spiced Sugar-Honey Glaze',131,0.000,1,'Donatella still remembers the lure of these addictive sweets. \"I always got in trouble with my aunt because I would sneak into the kitchen and steal them,\" she says. Frying the dough in extra-virgin olive oil adds an authentic flavor. You\'ll need about five cups of oil for frying.','2010-04-06 04:00:00'),(38,'Sauteed Broccoli Rabe',131,4.375,1,'Active time: 25 min Start to finish: 30 min','2004-08-20 04:00:00'),(39,'Grouper with Tomato and Basil',131,4.375,1,NULL,'2004-08-20 04:00:00'),(40,'Better-Than-Pita Grill Bread',131,2.500,1,'Cooking these flatbreads in a grill pan gives them a smoky flavor. They can be served with hummus or the Lebanese Lamb and Bean Stew. Don\'t expect a pocket — they are like rustic tortillas.','2006-07-24 18:27:47'),(41,'Coconut-Key Lime Sheet Cake',131,4.375,1,'This moist and fluffy dessert uses toasted coconut, coconut milk, and coconut oil to infuse as much flavor as possible into the cake. Good thing this sheet cake serves a crowd—the creamy key lime topping will have your guests coming back for a second piece.','2016-03-21 14:14:00'),(42,'Baked Halibut with Orzo, Spinach, and Cherry Tomatoes',131,4.375,1,'Kristi Parnell of San Marcos, California, writes: \"Whether I\'m cooking for my family or for company, I like to keep my recipes healthy by using lots of fresh fish and vegetables. The baked halibut here has become a weeknight staple.\"','2005-10-01 04:00:00'),(43,'Honey Rye',131,0.000,1,'For inspiration, co-owner Eyal Raziel looked to his native Israel, where honey liqueur is popular. \"The Bärenjäger balances the kick of the rye,\" he says.','2011-08-10 04:00:00'),(44,'Purple-Potato and Crab Gratin',131,3.750,1,'This recipe originally accompanied Poached Halibut with Black Truffles and Purple-Potato and Crab Gratin .','2004-08-20 04:00:00'),(45,'Grilled Beef, Jícama, and Apple Salad',131,4.375,1,'This Thai-inspired salad has that classic tart-sweet-spicy flavor balance that really gets your taste buds dancing. The cool, crunchy herb-laced salad is the yin to the yang of the rich tender beef. Whats more, the food processor does most of the work.','2013-07-31 04:00:00'),(46,'Pickled Red Onions',131,4.375,1,'A habanero chile gives these onions a nice bit of heat.','2007-04-24 21:31:48'),(47,'Spicy Black Beans and Rice',131,3.750,1,NULL,'2004-08-20 04:00:00'),(48,'Herbed Goat Cheese Spread with Mint',131,4.375,1,'This easy appetizer is packed with flavor. And since this is a Latin-themed party, dont forget to set out a bowl of chips with your favorite salsa.','2008-11-04 04:00:00'),(49,'Mexican Lime Soup',131,4.375,1,'A homey yet sophisticated soup that\'s great for casual entertaining.','2004-08-20 04:00:00'),(50,'Citrus Salad with Mint Sugar',131,4.375,1,NULL,'2004-08-20 04:00:00'),(51,'Mexican Chile and Mushroom Soup',131,3.125,1,NULL,'2006-05-16 20:12:06'),(52,'Peanut Butter-Banana Muffins',131,3.750,1,NULL,'2004-08-20 04:00:00'),(53,'Braised Chicken With Artichokes and Olives',131,4.375,1,'I didn\'t think it was possible to love artichokes more than I already did until I lived in Italy. There they harvest artichokes in both spring and fall, and that abundance graces their cuisine. Artichokes also enhance their health, as they stimulate the gallbladder to produce bile, which escorts toxins out of the body and also helps break down fats in the diet. Here, artichoke hearts are combined with chicken, chickpeas, and olives to create a rich, nourishing stew, seasoned with a potpourri of heady and healthful spices, including turmeric, cumin, coriander, and mint. For a wonderful pairing, serve it over Brown Rice Pilaf with Saffron and Ginger .','2013-02-20 04:00:00'),(54,'Pancetta Roast Chicken with Walnut Stuffing',131,5.000,1,'Topping the chicken with pancetta slices before roasting adds a rich flavor.','2008-04-02 18:27:00'),(55,'1977 Coconut Angel Food Cake',131,3.750,1,NULL,'2004-08-20 04:00:00'),(56,'Collard-and-Prosciutto Chicken Roulades Over Watercress Salad',131,5.000,1,'This is a simple recipe that tends to impress. These elegant roulades are surprisingly easy to make and will get you a standing ovation at the dinner table. Take a bow, as you\'re giving everyone a nice dose of brain protection thanks to the vitamin A, vitamin C, vitamin K, fiber, and phytonutrients found in the watercress and collards. If you can\'t locate fresh figs, swap in two thinly sliced ripe pears, and feel free to swap out the collards for kale.','2016-07-06 13:00:00'),(57,'Veal Burgers Stuffed with Mozzarella Cheese',131,4.375,1,NULL,'2004-08-20 04:00:00'),(58,'Pumpkin Muffins',131,4.375,1,'Just right for breakfast on the go, these muffins are subtly spiced, fluffy, and speckled with plenty of golden raisins.','2008-10-16 04:00:00'),(59,'Orange Balsamic Glaze',131,3.750,1,'This recipe is an accompaniment for Buffalo Prime Rib with Orange Balsamic Glaze.','2004-08-20 04:00:00'),(60,'Roasted Eggplant and Olive Spread with Pita Bread Chips',131,3.750,1,NULL,'2004-08-20 04:00:00'),(61,'Pecan Blue Cheese Crackers',131,3.750,1,NULL,'2004-08-20 12:48:48'),(62,'Romaine, Grilled Avocado, and Smoky Corn Salad with Chipotle-Caesar Dressing',131,4.375,1,'Grilled avocado is one of those things that sound faintly ridiculous until you try it—then you wonder why you never had it before.','2009-05-21 04:00:00'),(63,'Southwest Corn Bread Stuffing with Corn and Green Chilies',131,5.000,1,'For best results, make this stuffing with day-old Buttermilk Corn Bread.','2004-08-20 04:00:00'),(64,'Colin Perry’s Sorghum and Apple Sticky Pudding',131,0.000,1,'Eastern Kentucky–born and –raised chef Colin Perry plies his art now in Montreal at Dinette Triple Crown. The food there taps into traditions of both the far north and the high country South, as in this delectably oh-so-sticky pudding. “I tend to use a lot of maple syrup in my cooking up here, because it’s so delicious and so accessible. But sometimes the taste of sorghum is the only taste that will do,” he says. Really fresh leaf lard has become more available in recent years from artisan butchers and specialty stores. If you can’t get real lard, then use butter. Shortening and grocery-store lard aren’t worth it.','2016-08-31 21:13:22'),(65,'Mixed Berry Pavlovas',131,3.750,1,NULL,'2004-08-20 04:00:00'),(66,'Orange-Almond Cake with Chocolate Icing',131,4.375,1,'An impressive-looking layer cake with great flavor—and lots of room for candles.','2004-08-20 04:00:00'),(67,'Scarborough Fair Tofu Burger',131,3.125,1,'Wheat Free','2011-06-23 04:00:00'),(68,'Italian Vinaigrette',131,3.750,1,'This vinaigrette is great on any type of mixed green, pasta, or marinated vegetable salads.','2004-08-20 04:00:00'),(69,'White Chocolate Tartlets with Strawberries and Bananas',131,4.375,1,'White Chocolate Tartlets with Strawberries and Bananas These irresistible sweets feature a hazelnut crust that is lined with dark chocolate and filled with white chocolate mousse.','2004-08-20 04:00:00'),(70,'Tomato-Infused Bulgur Pilaf with Fresh Basil',131,0.000,1,'When an abundance of fresh vine-ripened tomatoes piles high on my mother\'s kitchen counter in Thessa-loniki, she cooks up a simple pot of juicy bulgur with the fruit. This classic pairing is born out of necessity in the heat of summer in many parts of the Mediterranean. It nicely accompanies lamb chops, flank steak, chicken breast, or grilled shrimp.','2013-09-20 04:00:00'),(71,'Roasted Butternut Squash, Rosemary, and Garlic Lasagne',131,4.375,1,NULL,'2004-08-20 04:00:00'),(72,'Grilled Roast Beef and Stilton Sandwich',131,4.375,1,NULL,'2004-08-20 04:00:00'),(73,'Pear-Hazelnut Cheesecakes with Pear-Raspberry Sauce',131,3.750,1,'Make these individual desserts a day ahead.','2004-08-20 04:00:00'),(74,'Nut Butter',131,3.750,1,NULL,'2012-05-18 04:00:00'),(75,'Cheese Ravioli with Fresh Tomato Sauce',131,3.750,1,NULL,'2006-03-01 04:00:00'),(76,'Banana Layer Cake with Cream Cheese Frosting',131,4.375,1,NULL,'2004-08-20 04:00:00'),(77,'South American-Style Jícama and Orange Salad',131,3.125,1,NULL,'2004-08-20 04:00:00'),(78,'Roasted Acorn Squash and Chestnuts',131,3.750,1,NULL,'2004-08-20 12:48:48'),(79,'Maple Pumpkin Pots de Crème',131,4.375,1,'Active time: 30 min Start to finish: 3 hr','2004-08-20 04:00:00'),(80,'Anadama Rolls with Mixed Seeds',131,3.750,1,'Anadama bread recipes, which date back to pre-Revolutionary New England, all call for molasses and cornmeal for substantial- and delicious- results. This contemporary rendition is no exception.','2004-08-20 04:00:00'),(81,'Braised Chicken and Rice with Orange, Saffron, Almond, and Pistachio Syrup',131,4.375,1,'Here is a jewel of an Afghani dish. Unusual and exotic, it is one I cook regularly, sometimes with shoulder of lamb instead of chicken thighs. I serve it with slow-cooked spinach, finished with leeks and a minuscule amount of rhubarb. This may sound strange, but the rhubarb is sweetened by the leeks and it really does work.','2010-04-06 04:00:00'),(82,'Horseradish Dill Potato Salad',131,4.375,1,'Can be prepared in 45 minutes or less.','2004-08-20 04:00:00'),(83,'Chicken in Green Pumpkin-Seed Sauce',131,4.375,1,'Pipián Verde con Pollo','2004-08-20 12:48:48'),(84,'Jeweled Rice',131,5.000,1,'Yes, making this rice is a time commitment and a labor of love. But the ingredients aren\'t difficult to find, and the finished dish is stunning.','2013-05-09 04:00:00'),(85,'Braised Brisket with Bourbon-Peach Glaze',131,4.375,1,'No one will fault you for seasoning brisket with salt and pepper, braising it in beer, and calling it a day. But follow chef Lee\'s method—which calls for a bath of stout, bourbon, and soy sauce; a glaze made with peach jam; and a side of easy homemade pickles if you\'d like—and you\'re on the path to savory-and-sweet nirvana.','2012-01-18 04:00:00'),(86,'Grilled Pork Chops with Classic Barbecue Sauce',131,4.375,1,'Constant basting with this lively sauce ensures moist chops and plenty of flavor. Warm potato salad with tarragon and white wine is the natural accompaniment.','2004-08-20 04:00:00'),(87,'Bacon Crackers',131,0.000,1,'These dangerously addictive little bites fueled countless 1950s and \'60s bridge parties from Greenwood Mississippi, to Greenville, South Carolina, before being rescued from recipe-box oblivion by modern Southern cooks like Martha Hall Foose. And thank goodness. Magic happens when a cracker slowly sops up the fat from smoky, crisping bacon; it transforms into something more akin to piecrust. Unadorned, bacon crackers are pure pork perfection. The addition of a tine bundle of rosemary needles makes for a fancified version, while topping the \"belt\" of bacon with a bit of brown sugar adds a hint of sweet to the smoke.','2015-11-05 12:00:00'),(88,'Roast Chicken With Sorghum and Squash',131,0.000,1,'Sorghum is a gluten-free grain, with a texture similar to wheat berries, barley, and millet—so feel free to substitute those for this chicken recipe instead.','2016-11-21 21:53:28'),(89,'Asparagus with Bacon and Onion',131,4.375,1,NULL,'2006-03-07 04:00:00'),(90,'Ricotta Omelets',131,3.750,1,'This also makes a great dinner for one; just cut the ingredients in half.','2013-05-09 04:00:00'),(91,'Carrot, Snow Pea, and Red Pepper Julienne in Honey Vinaigrette',131,3.750,1,'This recipe was created to accompany Chicken with Mustard Seed Crust and Couscous. Can be prepared in 45 minutes or less.','2004-08-20 04:00:00'),(92,'Salmon with Chili-Mango Salsa',131,4.375,1,'In Tucson, chef-owner Janos Wilder offers cumin-flavored rice pilaf and grilled zucchini with the fish. Flan is a good finale.','2004-08-20 04:00:00'),(93,'Turkey and Pinto Bean Chili',131,4.375,1,'Just like some Mexican moles, this chili has a bit of chocolate in it. Serve sour cream and shredded sharp cheddar cheese alongside.','2004-08-20 04:00:00'),(94,'Cucumber-Yogurt Salad with Mint',131,3.750,1,NULL,'2004-08-20 04:00:00'),(95,'Lamb Shanks Braised with Anise and Orange',131,3.125,1,'For convenience, the lamb can be prepared one day ahead, then slowly rewarmed before you plan to serve it.','2004-08-20 04:00:00'),(96,'Parsley Mayo',131,0.000,1,NULL,'2014-12-02 04:00:00'),(97,'Acini di Pepe Pasta with Garlic and Olives',131,4.375,1,'Small pasta like acini di pepe and orzo make wonderful room-temperature salads, since they mix so thoroughly with the other ingredients and never go stiff. Garlic, olives, and chile flakes lend a lot of zip to this quick side dish you\'ll come back to all summer.','2008-05-12 19:57:03'),(98,'Roast Beef Salad with Cabbage and Horseradish',131,3.125,1,NULL,'2004-08-20 04:00:00'),(99,'Savoy Cabbage and Arugula Salad',131,3.125,1,NULL,'2004-08-20 12:48:48'),(100,'Fennel, Beet and Orange Salad with Olives',131,4.375,1,NULL,'2004-08-20 04:00:00'),(961,'Three bean salad',151,4.500,2,'A vinegar-y summer salad perfect for an outdoor meal!','2020-05-29 01:35:25');
